import React, {useEffect, useState} from 'react';
import './App.css';
import io from 'socket.io-client';


function App() {
  const [socket, setSocket] = useState(null)
  useEffect(() => {
    setSocket(io())
  }, [])
  return (
    <div>

    </div>
  );
}

export default App;
